import React, { Component } from 'react';
import axios from 'axios';


class NewsABC extends Component{
    constructor(props){
        super(props);
        this.state={
            news:[],
        };
    }

    getNews = ()=>{
        axios.get(`https://nalvnsmartnews.herokuapp.com/api/category/news/${this.props.match.params.userId}`)
            .then((response) => {
                const getCategory = response;
                console.log(getCategory);
            })
            .catch(function (error) {
                console.log(error);
            });
        // console.log(this.props.match.params.userId);
        // console.log(`https://nalvnsmartnews.herokuapp.com/api/category/news/${this.props.match.params.userId}`);
    }

    componentDidMount() {
         this.getNews();
    }

    render() {
        return(
            <div>
                <h3>news1</h3>
            </div>
        );
    }
}
export default NewsABC;
